using ll = int64_t;

namespace {

    const std::string input_real = "";


    decltype(input_real) input_test = "dabAcCaCBAcCcaDA";
//    auto &input = input_test;
    auto &input = input_real;

    bool is_reaction(char a, char b) {
        return a != b && tolower(a) == tolower(b);
    }

    std::string react(const std::string &chain) {
        std::string result;
        size_t i = 0;
        size_t j = 1;
        while (i < chain.size() && j < chain.size()) {
            if (is_reaction(chain[i], chain[j])) {
                i += 2;
                j += 2;
            } else {
                result += chain[i];
                ++i;
                ++j;
            }
        }
        if (i < chain.size()) {
            result += chain[i];
        }
        return result;
    }

    std::string react_recursive(const std::string &chain) {
        std::string old_chain = chain;
        while (true) {
            auto new_chain = react(old_chain);
            if (new_chain.size() == old_chain.size()) {
                return new_chain;
            }
            std::swap(old_chain, new_chain);
        }
    }

    std::string filter(const std::string &chain, char letter) {
        auto new_chain = chain;
        auto it = std::remove_if(new_chain.begin(), new_chain.end(),
                                 [low = tolower(letter), up = toupper(letter)](const char c) {
                                     return c == low || c == up;
                                 });
        new_chain.erase(it, new_chain.end());
        return new_chain;
    }
}

int main05() {
    myprint(react_recursive(input).size());

    ll min_react_size = INT64_MAX;
    for (char c = 'a'; c <= 'z'; ++c) {
        ll react_size = react_recursive(filter(input, c)).size();
        if (min_react_size > react_size) {
            min_react_size = react_size;
        }
    }
    myprint(min_react_size);
    return 0;
}
